import React from 'react';

const KnowledgePage = () => {
  return (
    <div className="p-6">
        <h1 className="text-2xl font-bold text-gray-800 mb-6">ナレッジ</h1>
        <div className="bg-white rounded-lg shadow p-6">
          <p className="text-gray-600">
            ナレッジベースを管理します。よくある質問、解決手順、技術情報などを共有・検索できます。
          </p>
        </div>
      </div>
  );
};

export default KnowledgePage;
